import { DataGrid } from '@mui/x-data-grid';
import axios from 'axios';
import * as React from 'react';
import {useEffect} from 'react'

function App() {

  useEffect(()=>{
    console.log(getData())
  },[])

async function getData(){
  let response = await axios.post("http://localhost:5000/items/getItems", {pid:1})
  return response.data
}

  const columns = [
    { field:"id", headerName:"ID", width: 20},
    { field: "wizProduct", headerName: "Animal Wiz Product", width:200},
    { field: "amazonProducts", headerName: "Amazon Products", width:200},
    { field: "petSmartProducts", headerName: "Pet Smart Products", width:200}
  ];

  const rows = [
    {id:1, wizProduct:"Shoes", amazonProducts: ["Shoe1","Shoe2"], petSmartProducts:["Shoe1", "Shoe2"]}
  ];

  return (
    <>
    <div style={{height:500, margin:"auto"}}>
      <DataGrid
      rows={rows}
      columns={columns}
      pageSize={5}
      rowsPerPageOptions={[5]}
      checkboxSelection
      />

    </div>
    </>
  );
}

export default App;
